import React from 'react';
import './App.css';
import { Route, Routes, Navigate } from 'react-router-dom';
import { AuthProvider } from './Context/AuthContext';
import ProtectedRoute from './Components/Auth/ProtectedRoute';
import Login from './Components/Auth/Login';
import Register from './Components/Auth/Register';

// Import components
import HomePage from './Components/Home/HomePage';
import Home from './Components/Home/Home';
import Inventory from './Components/Inventory/Inventory';
import Orders from './Components/Orders/Orders';
import Reports from './Components/Reports/Reports';
import Settings from './Components/Settings/Settings';
import Recycling from './Components/Recycling/Recycling';
import BranchManager from './Components/BranchManager/BranchManager';

// New components (to be created)
import Products from './Components/Products/Products';
import ProductDetails from './Components/Products/ProductDetails';
import Cart from './Components/Cart/Cart';
import Checkout from './Components/Checkout/Checkout';
import Payment from './Components/Payment/Payment';
import Services from './Components/Services/Services';
import Branches from './Components/Branches/Branches';
import About from './Components/About/About';
import Contact from './Components/Contact/Contact';
import Profile from './Components/Profile/Profile';
import AdminDashboard from './Components/Admin/AdminDashboard';
import DriverDashboard from './Components/Driver/DriverDashboard';
import EmergencySystem from './Components/Emergency/EmergencySystem';

function App() {
  return (
    <AuthProvider>
      <div>
        <React.Fragment>
          <Routes>
            {/* Public routes */}
            <Route path="/" element={<HomePage />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />

            {/* Customer-facing routes */}
            <Route path="/products" element={<Products />} />
            <Route path="/products/:category" element={<Products />} />
            <Route path="/product/:id" element={<ProductDetails />} />
            <Route path="/cart" element={<Cart />} />
            <Route path="/checkout" element={<Checkout />} />
            <Route path="/payment" element={<Payment />} />
            <Route path="/services" element={<Services />} />
            <Route path="/branches" element={<Branches />} />
            <Route path="/about" element={<About />} />
            <Route path="/contact" element={<Contact />} />

            {/* Protected routes */}
            <Route path="/profile" element={
              <ProtectedRoute requiredRole={['Customer', 'Factory Manager', 'Branch Manager', 'Driver', 'Admin']}>
                <Profile />
              </ProtectedRoute>
            } />

            {/* Protected Factory Manager routes */}
            <Route path="/factory-dashboard" element={
              <ProtectedRoute requiredRole="Factory Manager">
                <Home />
              </ProtectedRoute>
            } />
            <Route path="/factory-inventory" element={
              <ProtectedRoute requiredRole="Factory Manager">
                <Inventory />
              </ProtectedRoute>
            } />
            <Route path="/factory-orders" element={
              <ProtectedRoute requiredRole="Factory Manager">
                <Orders />
              </ProtectedRoute>
            } />
            <Route path="/factory-recycling" element={
              <ProtectedRoute requiredRole="Factory Manager">
                <Recycling />
              </ProtectedRoute>
            } />
            <Route path="/factory-reports" element={
              <ProtectedRoute requiredRole="Factory Manager">
                <Reports />
              </ProtectedRoute>
            } />
            <Route path="/factory-settings" element={
              <ProtectedRoute requiredRole="Factory Manager">
                <Settings />
              </ProtectedRoute>
            } />

            {/* Protected Branch Manager routes */}
            <Route path="/branch-manager/*" element={
              <ProtectedRoute requiredRole="Branch Manager">
                <BranchManager />
              </ProtectedRoute>
            } />

            {/* Protected Admin routes */}
            <Route path="/admin/*" element={
              <ProtectedRoute requiredRole="Admin">
                <AdminDashboard />
              </ProtectedRoute>
            } />

            {/* Protected Driver routes */}
            <Route path="/driver/*" element={
              <ProtectedRoute requiredRole="Driver">
                <DriverDashboard />
              </ProtectedRoute>
            } />

            {/* Emergency System routes */}
            <Route path="/emergency" element={<EmergencySystem />} />
            <Route path="/emergency/login" element={<Login />} />

            {/* Default redirect */}
            <Route path="*" element={<Navigate to="/" replace />} />
          </Routes>
        </React.Fragment>
      </div>
    </AuthProvider>
  );
}

export default App;
